import React from "react";
im

function Header() {
    return (
        <div className={styles.header}>  
          <div>
            <p>Reddit<span>MyVersion</span></p>
          </div>
          <form>
            <input
            type="text"
            placeholder="Search"
            id="search"
            />
            <input
            type="submit"
            />
          </form>
        </div>
    );
}

export default Header;
